import React, { useEffect, useState } from "react";
import NavbarComp from "../../../components/navbar/NavbarComp";
import stylemsg from "./message.module.css";
import { Col, Row } from "react-bootstrap";
import iconuser from "../../../assets/icons/user.png";
// import { io } from "socket.io-client";

function ChatUser() {
  // const socket = io("http://localhost:5005");
  // console.log(socket);
  return (
    <>
      <NavbarComp />
      <br />
      <div className={stylemsg.containermsg}>
        <Row>
          <Col md={6}>
            <div className={stylemsg.listchat}>
              <p className="p-2 ml-3">Chat Users</p>
              <div className={stylemsg.userchat}>
                <img src={iconuser} alt="userimage" width="40" />
                <div className={stylemsg.sender}>
                  <p>User one</p>
                  <p className={stylemsg.messageuser}>Hello admin...</p>
                </div>
              </div>
              <div className={stylemsg.userchat}>
                <img src={iconuser} alt="userimage" width="40" />
                <div className={stylemsg.sender}>
                  <p>User two</p>
                  <p className={stylemsg.messageuser}>Hello admin...</p>
                </div>
              </div>
            </div>
          </Col>
          <Col md={6}>
            <div className={stylemsg.chat}></div>
            <div className={stylemsg.chatinput}>
              <input type="text" className={stylemsg.inputmessage} />
              <button className={stylemsg.btnmsg}>Send</button>
            </div>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default ChatUser;
